import React from 'react';
import { connect } from 'react-redux';

const DashboardTable = ({ subreddit: { name, keywords } }) => {
  const displayKeywords = (subreddit) => {
    console.log('displayKeywords.');
    for (let i = 0; i < subreddit.keywords.length; i++) {
      console.log('keywords: ', subreddit.keywords[i]);
      return <tr>{subreddit.keywords[i]}</tr>;
    }
  };

  return (
    <table>
      <thead>
        <th colspan='2'>{name}</th>
      </thead>
      <tbody>{displayKeywords(keywords)}</tbody>
    </table>
  );
};

const mapStateToProps = (state) => ({
  subredditState: state.subreddit,
});

export default connect(mapStateToProps)(DashboardTable);
